import React ,{ Component } from 'react';
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import {
Container,
} from 'react-bootstrap'
import Row from 'react-bootstrap/Row'
import './UserHome.css'


class Recents extends Component {
    constructor(props) {
        super(props);
        this.state = {
        data: '',
        };
    }

    componentDidMount() {
        fetch('http://localhost:9000/recentCrops')
        .then(response => response.json())
        .then(data => this.setState({ data }));

        console.log
    }

    render(){
        return (
            <div class = "recentbids">
                <Container>
                    <Row>
                        {this.state.data}
                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 1
                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 2
                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 3
                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 4
                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 5
                    </Row>

                </Container>
            </div>
        );
    }
}

export default Recents;
